import CreateServer from '../BlogExtract/CreateServer.js'

const useStyles = makeStyles((theme) => ({
    btn: {
    },
    section: {
        padding: "70px 0",
        textAlign: "center"
    },
    title: {
        ...title,
        marginBottom: "1rem",
        marginTop: "30px",
        minHeight: "32px",
        textDecoration: "none"
    },
    description: {
        color: "#999"
    },
    item: {
        marginBottom: "3%",
        textAlign: "left"
    },
    itemBottom: {
        textAlign: "left"
    }
}));


export default function BlogExtractSection() {
    const classes = useStyles();
    return (
        <div>
        <div className={classes.section}>
            <GridContainer justify="center">
                <GridItem xs={12} sm={12} md={8}>
                    <h2 className={classes.title}>Quelques documents qui pourraient vous int√©resser.</h2>
                    <h5 className={classes.description}>
                        Cliquez juste sur <b>En savoir plus</b>.
                    </h5>
                    <br/>
