                </GridItem>
            </GridContainer>
        </div>
            <div>
                <GridContainer>
                    <GridItem xs={12} sm={12} md={4} className={classes.item}>
                        <GettingStartedUserCard/>
                    </GridItem>
                    <GridItem xs={12} sm={12} md={4} className={classes.item}>
                        <RegisterCard/>
                    </GridItem>
                    <GridItem xs={12} sm={12} md={4} className={classes.item}>
                        <GettingStartedTechCard/>
                    </GridItem>
                    <GridItem xs={12} sm={12} md={4} className={classes.item}>
                        <CreateServer/>
                    </GridItem>
                    <GridItem xs={12} sm={12} md={4} className={classes.item}>

                    </GridItem>
                    <GridItem xs={12} sm={12} md={4} className={classes.item}>

                    </GridItem>
                    <GridItem xs={12} sm={12} md={4} className={classes.itemBottom}>

                    </GridItem>
                    <GridItem xs={12} sm={12} md={4} className={classes.itemBottom}>

                    </GridItem>
                </GridContainer>
            </div>
        </div>
    );
}
